"use strict";(self.webpackChunkkershner_recipes=self.webpackChunkkershner_recipes||[]).push([[970],{4203:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/mac-salad","metadata":{"permalink":"/recipes/mac-salad","editUrl":"https://github.com/dkershner6/recipes/recipes/mac-salad.md","source":"@site/recipes/mac-salad.md","title":"Keto \\"Mac\\" Salad","description":"Keto Mac Salad recipe, using exactly zero Mac.","date":"2024-02-12T00:00:00.000Z","formattedDate":"February 12, 2024","tags":[{"label":"hawaiian","permalink":"/recipes/tags/hawaiian"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"bright","permalink":"/recipes/tags/bright"},{"label":"fresh","permalink":"/recipes/tags/fresh"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":0.775,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto \\"Mac\\" Salad","description":"Keto Mac Salad recipe, using exactly zero Mac.","authors":"dkershner","date":"2024-02-12T00:00:00.000Z","tags":["hawaiian","keto","bright","fresh","tried-and-true"]},"nextItem":{"title":"Keto Lasagna","permalink":"/recipes/lasagna"}},"content":"## Ingredients\\n\\n-   2 lbs of Cauliflower, in 1/2inch x 1/2inch chunks\\n-   1 medium red onion, minced\\n-   2 Fresno Peppers, minced\\n-   2 cups Castelvetrano Olives, pitted and sliced\\n-   3 cloves garlic, minced (or more, to taste)\\n-   1/2 cup Apple Cider Vinegar\\n-   1/4 cup Dijon Mustard with whole seeds\\n-   1/2 cup Mayonaise\\n-   Salt (to taste)\\n-   Pepper (to taste, but use a lot)\\n\\n## Instructions\\n\\n1. Steam Cauliflower until tender, but still has bite. This is by far the hardest part of the recipe, and when in doubt, pull it out EARLY. Too crunchy is better than too mushy.\\n2. In large colander, drain cauliflower, then rinse with copious cold water. This will help it cool down faster.\\n3. In large mixing bowl, mix all ingredients together well, starting with the more sauce-like ingredients.\\n4. Refreigerate for at least 2 hours, ideally overnight.\\n\\nServe at fridge temps, Enjoy!"},{"id":"/lasagna","metadata":{"permalink":"/recipes/lasagna","editUrl":"https://github.com/dkershner6/recipes/recipes/lasagna.md","source":"@site/recipes/lasagna.md","title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","date":"2024-02-10T00:00:00.000Z","formattedDate":"February 10, 2024","tags":[{"label":"comfort","permalink":"/recipes/tags/comfort"},{"label":"italian","permalink":"/recipes/tags/italian"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"savory","permalink":"/recipes/tags/savory"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":1.15,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","authors":"dkershner","date":"2024-02-10T00:00:00.000Z","tags":["comfort","italian","keto","savory","tried-and-true"]},"prevItem":{"title":"Keto \\"Mac\\" Salad","permalink":"/recipes/mac-salad"}},"content":"## Ingredients\\n\\n### Sauce\\n\\n-   1/4 cup extra virgin olive oil\\n-   1-1.5 lb ground turkey\\n-   1 stalk Celery\\n-   1 medium yellow onion\\n-   6 cloves garlic (or more, to taste)\\n-   2 Pints Chicken Stock\\n-   1/2 cup red wine (any)\\n-   2 pinches Italian Seasoning\\n-   2 bay leaf\\n-   2 Roma tomatoes\\n-   1 bunch collard greens (about 6-7 leaves)\\n-   1 cup almond flour\\n-   Calabrian Chili Flakes (to taste)\\n-   Salt (to taste)\\n-   Pepper (to taste)\\n\\n### Lasagna\\n\\n-   2 cans heart of palm lasagna noodles\\n-   14 oz queso fresco\\n-   Bit of grated parmesan\\n\\n## Instructions\\n\\n### Sauce\\n\\n1. In dutch oven or pot, olive oil and diced onion and celery until translucent.\\n2. Brown ground turkey, minced garlic, then add chicken stock. Bring back to light boil / simmer.\\n3. Add Italian seasoning, bay leaf, calabrian chili flakes, and red wine.\\n4. Remove ribs from collards, roughly chop, add.\\n5. Simmer for hours, at least 1-2.\\n6. Chop and add tomatoes.\\n7. Add almond flour.\\n8. Simmer for half hour.\\n9. Add salt, pepper.\\n\\n### Lasagna\\n\\n1. Preheat oven to 375F.\\n2. In Pyrex or similar baking dish, layer noodles, then sauce, then queso fresco, then parmesan 3 times each.\\n3. Top with pepper.\\n4. Bake for an hour until cheese is browned.\\n\\nWait a bit, then eat. Enjoy!"}]}')}}]);